function Technologies()
{
    return(
        <div>
         <h1>Technologies</h1>
         {/* define links for its children */}
         <ul class="nav">
  <li class="nav-item">
    <a class="nav-link active" aria-current="page" href="#">Active</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="#">Link</a>
  </li>
  
</ul>
        </div>
    )

    
}
export default Technologies
